import React from "react";
import './App.css';
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'


function App() {
  return (
    <Router>
    <div className="app">
      <Routes>

        <Route path='/' element={<Home/>} />
      <Header />
      <Home />

      </Routes>
    </div>
    </Router>
  );
}

export default App;
